(17297, 5, 579, 444, 444, '1. สามารถตั้งสติและจัดลำดับความสำคัญของงานได้ แม้เผชิญกับสถานการณ์กดดันหรือเวลาจำกัด\n\n- แสดงให้เห็นถึงการจัดการตนเองและการทำงานอย่างมีประสิทธิภาพภายใต้ความเครียด\n\n2. ไม่โทษผู้อื่นเมื่อเกิดข้อผิดพลาด แต่ยอมรับความจริงและร่วมมือแก้ไขปัญหาอย่างสร้างสรรค์\n\n- สะท้อนความรับผิดชอบและวุฒิภาวะทางอารมณ์ของมืออาชีพ\n\n3. มีความมุ่งมั่น ไม่ย่อท้อต่ออุปสรรค และปรับวิธีการทำงานให้เหมาะสมเพื่อบรรลุเป้าหมาย\n\n- แสดงถึงความยืดหยุ่น (resilience) และความตั้งใจจริงในการทำงานให้สำเร็จ', NULL, '2025-08-01 11:38:34', '2025-08-01 11:38:34'),
